import React from 'react';
import { Avatar, Box } from '@mui/material';

// Import all spell images
import barrierIcon from '../summonerSpellsImages/Barrier.webp';
import cleanseIcon from '../summonerSpellsImages/Cleanse.webp';
import flashIcon from '../summonerSpellsImages/Flash.webp';
import igniteIcon from '../summonerSpellsImages/Ignite.webp';
import exhaustIcon from '../summonerSpellsImages/Exhaust.webp';
import ghostIcon from '../summonerSpellsImages/Ghost.webp';
import healIcon from '../summonerSpellsImages/Heal.webp';
import clarityIcon from '../summonerSpellsImages/Clarity.webp';
import smiteIcon from '../summonerSpellsImages/Smite.webp';
import teleportIcon from '../summonerSpellsImages/Teleport.webp';
import markIcon from '../summonerSpellsImages/Mark.webp';
// Add other icons as needed...

// Mapping of summoner spell IDs or names to imported local images
const spellImages = {
  Barrier: barrierIcon,
  Cleanse: cleanseIcon,
  flash: flashIcon,
  Ignite: igniteIcon,
  Exhaust: exhaustIcon,
  Ghost: ghostIcon,
  Heal: healIcon,
  Clarity: clarityIcon,
  Smite: smiteIcon,
  Teleport: teleportIcon,
  Mark: markIcon,
  // Add other mappings for each spell here
};

function SpellImages({ spells }) {
  return (
    <Box display="flex" gap={0.5}>
      {spells.map((spellName, index) => (
        <Avatar
          key={index}
          src={spellImages[spellName] || ''} // Use local path or a default if missing
          alt={`Spell ${spellName}`}
          sx={{ width: 32, height: 32 }}
        />
      ))}
    </Box>
  );
}

export default SpellImages;
